Ext.data.JsonP['Bundles_View']({"guide":" <!doctype html> <html> <head> <title>Bundles View</title> <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\"> </meta></head> <body> <div class=\"container\"> <div class=\"header\"/> <div id=\"src-30083240\" class=\"content\"> <h1>Bundles View</h1> <p> </p> <ul class=\"toc-indentation\"><li class=\"\"> <p><a class=\"document-link\" href=\"#!/guide/Bundles_View-section-src-30083240_BundlesView-Overview\">Overview</a> </p> </li><li class=\"\"> <p><a class=\"document-link\" href=\"#!/guide/Bundles_View-section-src-30083240_BundlesView-Top-levelitems\">Top-level items</a> </p> </li><li class=\"\"> <p><a class=\"document-link\" href=\"#!/guide/Bundles_View-section-src-30083240_BundlesView-Bundleentryitems\">Bundle entry items</a> </p> <ul class=\"toc-indentation\"><li class=\"\"> <p><a class=\"document-link\" href=\"#!/guide/Bundles_View-section-src-30083240_BundlesView-Bundledirectories\">Bundle directories</a> </p> </li><li class=\"\"> <p><a class=\"document-link\" href=\"#!/guide/Bundles_View-section-src-30083240_BundlesView-Commands\">Commands</a> </p> </li><li class=\"\"> <p><a class=\"document-link\" href=\"#!/guide/Bundles_View-section-src-30083240_BundlesView-Filetemplates\">File templates</a> </p> </li><li class=\"\"> <p><a class=\"document-link\" href=\"#!/guide/Bundles_View-section-src-30083240_BundlesView-Menus\">Menus</a> </p> </li><li class=\"\"> <p><a class=\"document-link\" href=\"#!/guide/Bundles_View-section-src-30083240_BundlesView-Snippets\">Snippets</a> </p> </li></ul></li><li class=\"\"> <p><a class=\"document-link\" href=\"#!/guide/Bundles_View-section-src-30083240_BundlesView-Bundledirectoryitems\">Bundle directory items</a> </p> </li><li class=\"\"> <p><a class=\"document-link\" href=\"#!/guide/Bundles_View-section-src-30083240_BundlesView-Propertiesview\">Properties view</a> </p> </li></ul> <div class=\"section section-2\" id=\"src-30083240_BundlesView-Overview\"> <h2 class=\"heading\"><span>Overview</span></h2> <p>The Bundles View contains detailed information on all bundle folders and scripts that contribute to a given bundle. Bundles utilize an inheritance and override mechanisms that may be challenging to troubleshoot. The Bundles View gives you insight into these mechanisms, serving as a tool for troubleshooting Rubles. </p> </div> <div class=\"section section-2\" id=\"src-30083240_BundlesView-Top-levelitems\"> <h2 class=\"heading\"><span>Top-level items</span></h2> <p>When you first open the Bundles View, you are presented with a collapsed tree view. You will see an alphabetized list of bundle entries, one node for each bundle entry that has been loaded into the Studio environment. The term &quot;bundle entry&quot; refers to the collection of bundle directories that define the bundle and its element that you see within Studio. For more details, see <a class=\"document-link\" href=\"#!/guide/Ruble_Specification-section-src-30083218_safe-id-UnVibGVTcGVjaWZpY2F0aW9uLVJlZGVmaW5pbmcsT3ZlcnJpZGluZyxhbmRFeHRlbmRpbmdCdW5kbGVz\">Redefining, Overriding, and Extending Bundles</a> in the Ruble Specification guide. </p> <p> <img src=\"images/download/attachments/30083240/Bundles_View.png\" alt=\"images/download/attachments/30083240/Bundles_View.png\" class=\"confluence-embedded-image confluence-content-image-border\"> </img></p> </div> <div class=\"section section-2\" id=\"src-30083240_BundlesView-Bundleentryitems\"> <h2 class=\"heading\"><span>Bundle entry items</span></h2> <p>A bundle entry is composed of one or more bundle directories. If you expand a bundle entry in the Bundles View, you will reveal a collection of children associated with that bundle entry. Those entries are divided into two broad categories: bundle directories represented with blue folder icons and active bundle elements represented with yellow folder icons. </p> <div class=\"section section-3\" id=\"src-30083240_BundlesView-Bundledirectories\"> <h3 class=\"heading\"><span>Bundle directories</span></h3> <p>The children represented with blue folders are the bundle folders that contribute to this bundle entry. The remaining children using yellow folders contain lists of the commands, snippets, etc. that are active for this bundle entry taking bundle precedence and bundle overrides into account. For example, in the following image, the HTML bundle entry has been expanded. From this view, we see that the HTML bundle entry is defined by a single bundle folder located at &quot;/User/klindsey/Documents/DevRubles/...&quot;. We also see that the bundle entry includes Commands, File Templates, Menus, and Snippets. </p> <p> <img src=\"images/download/attachments/30083240/Bunde_Entry_Children.png\" alt=\"images/download/attachments/30083240/Bunde_Entry_Children.png\" class=\"confluence-embedded-image confluence-content-image-border\"> </img></p> </div> <div class=\"section section-3\" id=\"src-30083240_BundlesView-Commands\"> <h3 class=\"heading\"><span>Commands</span></h3> <p>The Commands folder contains a list of all active commands for the bundle entry. </p> <p> <img src=\"images/download/attachments/30083240/Commands.png\" alt=\"images/download/attachments/30083240/Commands.png\" class=\"confluence-embedded-image confluence-content-image-border\"> </img></p> </div> <div class=\"section section-3\" id=\"src-30083240_BundlesView-Filetemplates\"> <h3 class=\"heading\"><span>File templates</span></h3> <p>The File Templates folder contains a list of all active file templates for the bundle entry. </p> <p> <img src=\"images/download/attachments/30083240/File_Templates.png\" alt=\"images/download/attachments/30083240/File_Templates.png\" class=\"confluence-embedded-image confluence-content-image-border\"> </img></p> </div> <div class=\"section section-3\" id=\"src-30083240_BundlesView-Menus\"> <h3 class=\"heading\"><span>Menus</span></h3> <p>The Menus folder contains a list of all active menus for the bundle entry. Menus are hierarchical, so it is possible that menu items themselves will contain child menus. </p> <p> <img src=\"images/download/attachments/30083240/Menus.png\" alt=\"images/download/attachments/30083240/Menus.png\" class=\"confluence-embedded-image confluence-content-image-border\"> </img></p> </div> <div class=\"section section-3\" id=\"src-30083240_BundlesView-Snippets\"> <h3 class=\"heading\"><span>Snippets</span></h3> <p>The Commands folder contains a list of all active commands for the bundle entry. </p> <p> <img src=\"images/download/attachments/30083240/Snippets.png\" alt=\"images/download/attachments/30083240/Snippets.png\" class=\"confluence-embedded-image confluence-content-image-border\"> </img></p> </div> </div> <div class=\"section section-2\" id=\"src-30083240_BundlesView-Bundledirectoryitems\"> <h2 class=\"heading\"><span>Bundle directory items</span></h2> <p>A mentioned earlier, a bundle entry is composed of one or more bundle directories. If you expand a bundle directory, represented with blue folders, you will see the same Commands, File Templates, Menus, and Snippets folders; however, the items in those folders represent items that the bundle directory defines. Due to bundle precedence and override functionality, it is possible that even though an item is defined in a bundle directory, it may not contribute to the active items in the bundle entry. For more details, see <a class=\"document-link\" href=\"#!/guide/Ruble_Specification-section-src-30083218_safe-id-UnVibGVTcGVjaWZpY2F0aW9uLVJlZGVmaW5pbmcsT3ZlcnJpZGluZyxhbmRFeHRlbmRpbmdCdW5kbGVz\">Redefining, Overriding, and Extending Bundles</a> in the Ruble Specification guide. </p> <p> <img src=\"images/download/attachments/30083240/Bundle_Directory_Items.png\" alt=\"images/download/attachments/30083240/Bundle_Directory_Items.png\" class=\"confluence-embedded-image confluence-content-image-border\"> </img></p> </div> <div class=\"section section-2\" id=\"src-30083240_BundlesView-Propertiesview\"> <h2 class=\"heading\"><span>Properties view</span></h2> <p>Many of the items in the Bundles View show more information in the Properties View. Be sure to have that view open, then elect an item in the Bundles View to see more detail about that item. This is particularly helpful when you need to determine which file has contributed a particular item. </p> <p> <img src=\"images/download/attachments/30083240/Properties_View.png\" alt=\"images/download/attachments/30083240/Properties_View.png\" class=\"confluence-embedded-image confluence-content-image-border\"> </img></p> </div> </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=30083240\"><span>Edit</span></a> </div> </body> </html> ","title":"Bundles View"});